زندگی را آبستن است.
در خیالش آسمان و ریسمان میبافد از عشق و امید.
زلفش با نوای باد میرقصد و دامنش به پهنای آسمان بیکران  بر دشت سایه می اندازد.
با ارتشی از تگرگ، ابرها، طوفان و باران چنان میجنگد که نهال زندگی فارغ از هر گزند به بار بنشیند
گاه و بیگاه رقص کنان سرمست و سرخوش گام مینهد گویی دیوانه ای زنجیر گسیخته است
