برای من هایی که ما شد…

از روزی که تصمیم گرفتیم تا روزی که جامه عمل پوشاندیم به رویاها و آرزوها و دغدغه هایمان بالغ بر ۸ ماه میگذرد. همه چیز  از انقلاب زن زندگی آزادی آغاز شد. جلسه های پی در پی دیروقت هفته ای. هر بار با هزار دغدغه که باید کاری بکنیم با تمام خستگیِ روز پای حرف ها و دردل هم مینشستیم. ماجرا از یک رقص کردی برای حمایت از مردم کردستان و ژینا(مهسا) امینی و زنان ایران شروع شد، بعد به سالگرد جانباتگان هواپیما اوکراینی نزدیک شدیم. کمر همت بستیم برای یک‌اجرای خیابانی برای هواپیمای اوکراینی، برای آبان، برای مادران داغدار این سالها، برای مهسا، نیکا، سارینا، برای کیان، مونا، حدیث و برای ۷۰ کودک کشته شده، برای زندانیان بی نام و نشان ، برای آنان‌که چشمشان و آنانکه جانشان را از دست دادند و برای هر آنکس که سینه سپر کرد برای راه آزادی. 
۸ ژانویه، میدان داندس تورنتو، هوا -۱۰ درجه،  تمام بدنمان بی حس شده بود اما انقدر انگیزه داشتیم که با رقصمان صدایی باشیم برای مردم سرزمینمان ایران. فارغ از هر تظاهر  فقط ‌فقط مخاطبمان مردم کوچه و خیابان بودند ‌و بس. بعد از آنروز دغدغه هایمان بزرگتر شد. هر روز دیدن تصاویر رقصیدن و آواز خواندن دختران توی کوچه پس کوچه های ایران شد انگیزه ای برای قدمهای بزرگتر و گردهم‌آوردن ۲۱ زن ایرانی کنار هم و رغم زدن صحنه ای که در آن تمام احساسمان را بیان کنیم. 
ساده نبود و‌نیست اما ساختیمش، از خیلی خواستهایمان گذشتیم، تک تکمان، فقط و فقط برای رسیدن به آن لحظه که صدای زنان و مردان سرزمینمان باشیم و بگوییم ما هستیم و یادمان نرفته و  نمیرود. 

نه میبخشیم و نه فراموش میکنیم…

